#11 - Jungle Jim, ace manhunter of the far east, walks into a great adventure when he comes to the aid of an American girl, Lita Lark, in a Malacca cafe...&quot;Mission To Jade Island!&quot;

#12 - Jungle Jim crosses a path of fury as he pursues a bandit leader and matches wit against deceit in...&quot;Adventure On Sabango!&quot;

#13 - Jungle Jim and Kolu have been assigned by the British Foreign Office to solve a mystery on Cormorant Island. Nearing the island in a small boat, they abandon ship to rescue a pearl diver from a giant clam...and learn of--&quot;Mystery Island!&quot;

#14 - Herein Jungle Jim guides a botanical expedition in search of the world's most rare flower, a flower that will bring wealth and power to the one who possesses it...but those who have sought for it have always been dogged by disaster...and danger still waits at every turn in...&quot;Flowers Of Peril!&quot;

#15 - The ace man-hunter of the Orient, Jungle Jim, is thrown into the strangest adventure of his career when he meets Meg Dayton, who leads him along the...&quot;Trail Of Death!&quot;

